#include <stdio.h>
#include <stdlib.h>
#include <string.h>
#include <unistd.h>
#include <sys/types.h>
#include <sys/wait.h>
#include <dirent.h>
#include <err.h>


int semaphoreRead = -1;
int semaphoreWrite = -1;

void acquire() {
    if (write(semaphoreWrite, "a", 1) == -1) {
        err(1, "write");
    }
}

void release() {
    char buf;
    if (read(semaphoreRead, &buf, 1) == -1) {
        err(1, "read");
    }
}

void make(char *path);

void watcher(char *executable) {
    char path[300];
    getcwd(path, 300);
    printf("path: %s\n", path);
    printf("watcher: %s\n", executable);
    pid_t pid = fork();
    if (pid == -1) {
        err(1, "fork");
    } else if (pid == 0) { // Child process
        char fullpath[400];
        snprintf(fullpath, sizeof(fullpath), "%s/%s", path, executable + 2);
        printf("fullpath: %s\n", fullpath);
        char* params[] = {executable, NULL};
        execvp("fullpath", &executable);
        err(1, "execp");
    } else { // Parent process
        int status;
        waitpid(pid, &status, 0);
        release();
    }
}

void traverse_directory(char *path) {
    DIR *dir = opendir(path);
    printf("dir: %s\n", path);
    if (dir == NULL) {
        err(1, "opendir");
    }

    struct dirent *entry;
    while ((entry = readdir(dir)) != NULL) {
        if (strcmp(entry->d_name, ".") == 0 || strcmp(entry->d_name, "..") == 0) {
            continue;
        }

        char full_path[PATH_MAX];
        snprintf(full_path, sizeof(full_path), "%s/%s", path, entry->d_name);
        printf("full_path: %s\n", full_path);
        if (entry->d_type == DT_DIR) { // If entry is a directory, recursively traverse it
            printf("full_path_dir: %s\n", full_path);
            traverse_directory(full_path);
        } else if (access(full_path, X_OK) == 0) { // If entry is executable, run watcher
            acquire();
            printf("full_path exec: %s\n", full_path);
            watcher(full_path);
        }
    }

    closedir(dir);
}

void make(char *path) {
    traverse_directory(path);
    while (semaphoreWrite > 0) {
        acquire();
    }
}

int main(int argc, char *argv[]) {
    if (argc != 2) {
        fprintf(stderr, "Usage: %s <max_parallelism>\n", argv[0]);
        exit(1);
    }

    int max_parallelism = atoi(argv[1]);
    if (max_parallelism <= 0) {
        fprintf(stderr, "Invalid argument: %s\n", argv[1]);
        exit(1);
    }

    // Create semaphore using a pipe
    int pipefd[2];
    if (pipe(pipefd) == -1) {
        err(1, "pipe");
    }
    semaphoreRead = pipefd[0]; // Use the read end of the pipe as the semaphore
    semaphoreWrite = pipefd[1];

    make(".");
    close(pipefd[0]);
    close(pipefd[1]);

    return 0;
}

#include <stdio.h> 
#include <stdlib.h> 
#include <unistd.h> 
#include <dirent.h> 
#include <sys/types.h> 
#include <sys/stat.h> 
#include <string.h> 
#include <fcntl.h> 
#include <sys/wait.h> 
#include <err.h> 
 
#define MAX_PATH_LENGTH 1024 
 
int pipefd[2]; 
 
void explore_and_execute(const char *dirpath) { 
    DIR *dir; 
    struct dirent *entry; 
    char path[MAX_PATH_LENGTH]; 
    struct stat statbuf; 
    int active_processes = 0; 
 
    if (!(dir = opendir(dirpath))) 
        return; 
 
    while ((entry = readdir(dir)) != NULL) { 
        if (strcmp(entry->d_name, ".") == 0 || strcmp(entry->d_name, "..") == 0) 
            continue; 
 
        sprintf(path, "%s/%s", dirpath, entry->d_name); 
        if (stat(path, &statbuf) == -1) 
            continue; 
 
        if (S_ISDIR(statbuf.st_mode)) { 
            char dummy; 
            read(pipefd[0], &dummy, 1); 
            pid_t pid = fork(); 
            if (pid == 0) { 
                explore_and_execute(path); 
                exit(0); 
            } else if (pid > 0) { 
                active_processes++; 
                write(pipefd[1], &dummy, 1); 
            } 
        } else if (S_ISREG(statbuf.st_mode) && (statbuf.st_mode & S_IXUSR)) { 
            char dummy; 
            if (read(pipefd[0], &dummy, 1) != 1) { 
                err(1, "read from pipe"); 
            } 
            pid_t pid = fork(); 
            if (pid < 0) { 
                err(1, "fork"); 
            } else if (pid == 0) { 
                execl(path, path, (char *)NULL); 
                err(1, "execl"); 
            } 
            wait(NULL); 
            if (write(pipefd[1], &dummy, 1) != 1) { 
                err(1, "write to pipe"); 
            } 
        } 
    } 
    while (active_processes > 0) { 
        wait(NULL); 
        active_processes--; 
    } 
    closedir(dir); 
} 
 
void check_pipe(int limit_) { 
    for(int i = 0; i < limit_; i++) if(write(pipefd[1], "1", 1) != 1) err(1, "initialize error"); 
} 
 
int main(int argc, char *argv[]) { 
    int k = atoi(argv[1]); 
    pipe(pipefd); 
    check_pipe(k); 
 
    explore_and_execute("."); 
 
    close(pipefd[0]); 
    close(pipefd[1]); 
 
    return 0; 
}

